contracts/FlightDelayInsurance.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@chainlink/contracts/src/v0.8/ChainlinkClient.sol";
import "@chainlink/contracts/src/v0.8/shared/access/ConfirmedOwner.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract FlightDelayInsurance is ChainlinkClient, ConfirmedOwner {
    using Chainlink for Chainlink.Request;

    // Events
    event PolicyPurchased(address indexed buyer, string flightNumber, uint256 departureDate, uint256 premium);
    event ClaimPaid(address indexed policyholder, string flightNumber, uint256 departureDate, uint256 payoutAmount);
    event FlightDelayDataReceived(bytes32 indexed requestId, uint256 delay);
    event FlightVerified(bytes32 indexed requestId, bool verified);
    event AdminFeesWithdrawn(address indexed admin, uint256 amount);

    // Chainlink variables
    bytes32 private jobId;
    uint256 private fee;
    
    // Flight API endpoint
    string private apiUrl = "https://decentraflightapi.onrender.com";
    
    // Policy data structure
    struct Policy {
        address policyholder;
        string flightNumber;
        string airlineCode;
        uint256 departureDate; // Unix timestamp
        uint256 premium;
        bool claimed;
        bool verified;
    }
    
    // Insurance parameters
    uint256 public constant MIN_PREMIUM = 1 * 10**16; // 0.01 MATIC
    uint256 public constant MAX_PREMIUM = 1 * 10**18; // 1 MATIC
    uint256 public constant DELAY_THRESHOLD = 120; // 2 hours in minutes
    uint256 public constant PAYOUT_MULTIPLIER = 250; // 2.5x premium payout

    // Contract state variables
    uint256 public totalPolicies;
    uint256 public totalPremiums;
    uint256 public totalPayouts;
    uint256 public adminFees; // 5% of premiums
    
    // Mapping for policies by user
    mapping(address => Policy[]) public userPolicies;
    
    // Mapping to track Oracle requests 
    mapping(bytes32 => address) private requestToPolicyholder;
    mapping(bytes32 => uint256) private requestToPolicyIndex;
    mapping(bytes32 => bool) private requestIsVerification;

    // Constructor
    constructor() ConfirmedOwner(msg.sender) {
        setChainlinkToken(0x326C977E6efc84E512bB9C30f76E30c160eD06FB); // LINK token address on Amoy
        setChainlinkOracle(0xd36c6B1777c7f3Db1B3201bDD87081A9045B7b46); // LinkWell Oracle address
                
        jobId = "a8356f48569c434eaa4ac5fcb4db5cc0"; // LinkWell job ID for uint256
        fee = 0.1 * 10**18; // 0.1 LINK
    }
    
    // Purchase a flight delay insurance policy
    function purchasePolicy(string memory _airlineCode, string memory _flightNumber, uint256 _departureDate) external payable {
        require(msg.value >= MIN_PREMIUM, "Premium too low");
        require(msg.value <= MAX_PREMIUM, "Premium too high");
        require(_departureDate > block.timestamp, "Flight must be in the future");
        
        // Create a new policy
        Policy memory newPolicy = Policy({
            policyholder: msg.sender,
            flightNumber: _flightNumber,
            airlineCode: _airlineCode,
            departureDate: _departureDate,
            premium: msg.value,
            claimed: false,
            verified: false
        });
        
        // Add policy to user's policies
        userPolicies[msg.sender].push(newPolicy);
        uint256 policyIndex = userPolicies[msg.sender].length - 1;
        
        // Verify flight exists through Chainlink oracle
        verifyFlight(msg.sender, policyIndex, _airlineCode, _flightNumber, _departureDate);
        
        // Update contract state
        totalPolicies++;
        totalPremiums += msg.value;
        
        // Calculate admin fee (5%)
        uint256 fee = (msg.value * 5) / 100;
        adminFees += fee;
        
        emit PolicyPurchased(msg.sender, _flightNumber, _departureDate, msg.value);
    }
    
    // Verify flight exists through Chainlink
    function verifyFlight(address _policyholder, uint256 _policyIndex, string memory _airlineCode, string memory _flightNumber, uint256 _departureDate) internal {
        Chainlink.Request memory req = buildChainlinkRequest(
            jobId, 
            address(this), 
            this.fulfillFlightVerification.selector
        );
        
        // Convert timestamp to ISO date format YYYY-MM-DD
        string memory dateString = timestampToDateString(_departureDate);
        
        // Set the URL
        string memory url = string(abi.encodePacked(
            apiUrl, 
            "/api/verify-flight"
        ));
        req.add("post", url);
        
        // Set the headers
        req.add("headers", '{"Content-Type": "application/json"}');
        
        // Set the POST payload
        string memory payload = string(abi.encodePacked(
            '{"airline_iata":"', 
            _airlineCode, 
            '","flight_number":"', 
            _flightNumber, 
            '","departure_date":"', 
            dateString, 
            '"}'
        ));
        req.add("body", payload);
        
        // Set the path to the verification result
        req.add("path", "valid");
        
        // Send the request
        bytes32 requestId = sendChainlinkRequest(req, fee);
        
        // Store request mapping
        requestToPolicyholder[requestId] = _policyholder;
        requestToPolicyIndex[requestId] = _policyIndex;
        requestIsVerification[requestId] = true;
    }
    
    // Callback function for flight verification
    function fulfillFlightVerification(bytes32 _requestId, bool _verified) public recordChainlinkFulfillment(_requestId) {
        require(requestIsVerification[_requestId], "Request not for verification");
        
        address policyholder = requestToPolicyholder[_requestId];
        uint256 policyIndex = requestToPolicyIndex[_requestId];
        
        // Update policy verification status
        userPolicies[policyholder][policyIndex].verified = _verified;
        
        // If not verified, issue refund
        if (!_verified) {
            Policy storage policy = userPolicies[policyholder][policyIndex];
            uint256 refundAmount = policy.premium;
            totalPremiums -= refundAmount;
            adminFees -= (refundAmount * 5) / 100;
            
            // Transfer refund
            (bool success, ) = policyholder.call{value: refundAmount}("");
            require(success, "Refund transfer failed");
        }
        
        emit FlightVerified(_requestId, _verified);
    }
    
    // File a claim for flight delay
    function fileClaim(uint256 _policyIndex) external {
        require(_policyIndex < userPolicies[msg.sender].length, "Invalid policy index");
        
        Policy storage policy = userPolicies[msg.sender][_policyIndex];
        
        require(policy.verified, "Flight not verified");
        require(!policy.claimed, "Claim already processed");
        require(block.timestamp > policy.departureDate, "Flight hasn't departed yet");
        
        // Check flight delay through Chainlink oracle
        checkFlightDelay(msg.sender, _policyIndex, policy.airlineCode, policy.flightNumber, policy.departureDate);
    }
    
    // Check flight delay through Chainlink
    function checkFlightDelay(address _policyholder, uint256 _policyIndex, string memory _airlineCode, string memory _flightNumber, uint256 _departureDate) internal {
        Chainlink.Request memory req = buildChainlinkRequest(
            jobId, 
            address(this), 
            this.fulfillFlightDelay.selector
        );
        
        // Convert timestamp to ISO date format YYYY-MM-DD
        string memory dateString = timestampToDateString(_departureDate);
        string memory flightIata = string(abi.encodePacked(_airlineCode, _flightNumber));
        
        // Set the URL
        string memory url = string(abi.encodePacked(
            apiUrl, 
            "/api/flight-delay?flight_iata=", 
            flightIata, 
            "&departure_date=", 
            dateString
        ));
        req.add("get", url);
        
        // Set the path to the delay minutes
        req.add("path", "delay_minutes");
        
        // Send the request
        bytes32 requestId = sendChainlinkRequest(req, fee);
        
        // Store request mapping
        requestToPolicyholder[requestId] = _policyholder;
        requestToPolicyIndex[requestId] = _policyIndex;
        requestIsVerification[requestId] = false;
    }
    
    // Callback function for flight delay
    function fulfillFlightDelay(bytes32 _requestId, uint256 _delayMinutes) public recordChainlinkFulfillment(_requestId) {
        require(!requestIsVerification[_requestId], "Request not for delay check");
        
        address policyholder = requestToPolicyholder[_requestId];
        uint256 policyIndex = requestToPolicyIndex[_requestId];
        Policy storage policy = userPolicies[policyholder][policyIndex];
        
        // Mark as claimed
        policy.claimed = true;
        
        emit FlightDelayDataReceived(_requestId, _delayMinutes);
        
        // Check if delay qualifies for payout
        if (_delayMinutes >= DELAY_THRESHOLD) {
            // Calculate payout (2.5x premium)
            uint256 payoutAmount = (policy.premium * PAYOUT_MULTIPLIER) / 100;
            
            // Ensure contract has enough balance
            require(address(this).balance >= payoutAmount, "Insufficient contract balance");
            
            // Update state
            totalPayouts += payoutAmount;
            
            // Transfer payout
            (bool success, ) = policyholder.call{value: payoutAmount}("");
            require(success, "Payout transfer failed");
            
            emit ClaimPaid(policyholder, policy.flightNumber, policy.departureDate, payoutAmount);
        }
    }
    
    // Allow admin to withdraw fees
    function withdrawAdminFees() external onlyOwner {
        require(adminFees > 0, "No fees to withdraw");
        uint256 amount = adminFees;
        adminFees = 0;
        
        (bool success, ) = owner().call{value: amount}("");
        require(success, "Admin fee transfer failed");
        
        emit AdminFeesWithdrawn(owner(), amount);
    }
    
    // Get all policies for a user
    function getUserPolicies(address _user) external view returns (Policy[] memory) {
        return userPolicies[_user];
    }
    
    // Utility function to convert timestamp to date string
    function timestampToDateString(uint256 _timestamp) internal pure returns (string memory) {
        // Logic to convert timestamp to YYYY-MM-DD format
        // This is a simplified version
        uint256 year = 1970;
        uint256 month = 1;
        uint256 day = 1;
        uint256 secondsInDay = 86400;
        uint256 daysFromEpoch = _timestamp / secondsInDay;
        
        // Adjust for years
        while (daysFromEpoch >= 365) {
            bool isLeapYear = (year % 4 == 0 && (year % 100 != 0 || year % 400 == 0));
            uint256 daysInYear = isLeapYear ? 366 : 365;
            
            if (daysFromEpoch >= daysInYear) {
                daysFromEpoch -= daysInYear;
                year++;
            } else {
                break;
            }
        }
        
        // Adjust for months
        uint8[12] memory daysInMonth = [31, 28, 31, 30, 31, 30, 31, 31, 30, 31, 30, 31];
        if (year % 4 == 0 && (year % 100 != 0 || year % 400 == 0)) {
            daysInMonth[1] = 29; // February in leap year
        }
        
        while (month <= 12) {
            if (daysFromEpoch >= daysInMonth[month-1]) {
                daysFromEpoch -= daysInMonth[month-1];
                month++;
            } else {
                break;
            }
        }
        
        // Remaining days
        day += daysFromEpoch;
        
        // Format date string
        return string(abi.encodePacked(
            uint2str(year), "-",
            month < 10 ? string(abi.encodePacked("0", uint2str(month))) : uint2str(month), "-",
            day < 10 ? string(abi.encodePacked("0", uint2str(day))) : uint2str(day)
        ));
    }
    
    // Convert uint to string
    function uint2str(uint256 _i) internal pure returns (string memory) {
        if (_i == 0) {
            return "0";
        }
        
        uint256 j = _i;
        uint256 length;
        while (j != 0) {
            length++;
            j /= 10;
        }
        
        bytes memory bstr = new bytes(length);
        uint256 k = length;
        while (_i != 0) {
            k = k-1;
            uint8 temp = (48 + uint8(_i - _i / 10 * 10));
            bytes1 b1 = bytes1(temp);
            bstr[k] = b1;
            _i /= 10;
        }
        
        return string(bstr);
    }
    
    // Receive function to accept MATIC
    receive() external payable {}
}

